import React from 'react'
import './style.css';
import { Link, Outlet } from "react-router-dom";

const Header = () => {
  return (
    <>
    <div className='header'>
    <ul>
        <li><Link to="/Menu">Home</Link></li>
        <li><Link to="/Api">Api</Link></li>
        <li><Link to="/Lessons">Lessons</Link></li>
      </ul>
    </div>

    <Outlet />

    <footer> 2022</footer>
    </>


  )
}


export default Header;
